import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import { useEffect } from 'react';
import api from '../../../../components/API/API';



export default function Userlist() {
    const [rows,setRows]=React.useState([])

    useEffect(() => {
        const getdata=async()=>{
            await api.get('alluser').then(
                setRows
            )


        }
      },[]);

  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead style={{background:"#007bff",color:"white"}}>
          <TableRow>
            <TableCell style={{color:"white"}}>Full name</TableCell>
            <TableCell style={{color:"white"}} align="right">Email</TableCell>
            <TableCell style={{color:"white"}} align="right">Status</TableCell>
            <TableCell style={{color:"white"}}  align="right">Actions</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
            >
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.calories}</TableCell>
              <TableCell align="right">{row.fat}</TableCell>
              <TableCell align="right">{row.carbs}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
